import logo from './logo.svg';
import './App.css';

function Car() {
  return <h2>Hi, I am a Car!</h2>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          This are my pets
        </p>

        <Car></Car>

      </header>
    </div>
  );
}

export default App;
